INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "アヤネ", 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 10046, 24001, 401, "2030/12/17 14:59:59", 0.0, 102301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 2.21, "アヤネ", 2, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 10046, 24002, 402, "2030/12/17 14:59:59", 0.0, 102301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "アヤネ", 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 10046, 24003, 403, "2030/12/17 14:59:59", 0.0, 102301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 1.99, "アサヒ", 1, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 10046, 24004, 701, "2030/12/17 14:59:59", 0.0, 192201, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 2.21, "アサヒ", 2, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 10046, 24005, 702, "2030/12/17 14:59:59", 0.0, 192201, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 3.33, "アサヒ", 1, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 10046, 24006, 703, "2030/12/17 14:59:59", 0.0, 192201, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "部員３", 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 10046, 24007, 801, "2030/12/17 14:59:59", 0.0, 192301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 2.68, "部員３", 2, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 10046, 24008, 802, "2030/12/17 14:59:59", 0.0, 192301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "部員３", 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 10046, 24009, 803, "2030/12/17 14:59:59", 0.0, 192301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 0.0, "", 1, 0.0, "やった！", 10046, 24010, 501, "2030/12/17 14:59:59", 0.0, 192501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 0.0, "", 1, 0.0, "勝ったよ！", 10046, 24011, 502, "2030/12/17 14:59:59", 0.0, 192501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 0.0, "", 1, 0.0, "いい調子！", 10046, 24012, 503, "2030/12/17 14:59:59", 0.0, 192501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (6, "2020/07/31 12:00:00", 5.33, "ミサト", 2, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 10046, 24013, 111, "2030/12/17 14:59:59", 0.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 6.85, "ミサト", 2, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 10046, 24014, 112, "2030/12/17 14:59:59", 0.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 3.0, "ミサト", 2, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 10046, 24015, 113, "2030/12/17 14:59:59", 0.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 6.11, "ダイチ", 2, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 10046, 24016, 611, "2030/12/17 14:59:59", 0.0, 192401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 6.75, "ダイチ", 2, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 10046, 24017, 612, "2030/12/17 14:59:59", 0.0, 192401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "ダイチ", 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 10046, 24018, 613, "2030/12/17 14:59:59", 0.0, 192401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 4.52, "ハツネ", 1, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 10046, 24019, 211, "2030/12/17 14:59:59", 0.0, 113401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 3.89, "ハツネ", 1, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 10046, 24020, 212, "2030/12/17 14:59:59", 0.0, 113401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 13.49, "ハツネ", 2, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 10046, 24021, 213, "2030/12/17 14:59:59", 0.0, 113401, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 3.17, "カヤ", 2, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 10046, 24022, 311, "2030/12/17 14:59:59", 0.0, 106501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 4.42, "カヤ", 2, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 10046, 24023, 312, "2030/12/17 14:59:59", 0.0, 106501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (6, "2020/07/31 12:00:00", 2.89, "カヤ", 1, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 10046, 24024, 313, "2030/12/17 14:59:59", 0.0, 106501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (4, "2020/07/31 12:00:00", 3.71, "アヤネ", 3, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 10046, 24025, 421, "2030/12/17 14:59:59", 0.0, 102301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 5.1, "アサヒ", 1, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 10046, 24026, 721, "2030/12/17 14:59:59", 0.0, 192201, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 4.34, "部員３", 3, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 10046, 24027, 821, "2030/12/17 14:59:59", 0.0, 192301, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 0.0, "", 1, 0.0, "いい勝負だったよ\nまたやろうね", 10046, 24028, 521, "2030/12/17 14:59:59", 0.0, 192501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 5.62, "ミサト", 2, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 10046, 24029, 101, "2030/12/17 14:59:59", -360.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 9.58, "ミサト", 2, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 10046, 24030, 102, "2030/12/17 14:59:59", -360.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 0.0, "ミサト", 2, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 10046, 24031, 103, "2030/12/17 14:59:59", -360.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (2, "2020/07/31 12:00:00", 9.13, "ミサト", 1, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 10046, 24032, 104, "2030/12/17 14:59:59", -360.0, 113501, 24);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES (1, "2020/07/31 12:00:00", 8.27, "ミサト", 2, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 10046, 24033, 105, "2030/12/17 14:59:59", -360.0, 113501, 24);
